  width: 100%;
  padding: 0 20px;

  @include onMobile {
    &--off-mobile {
      padding: 0;
    }
  }

  @include onTablet {
    padding: 0 30px;

    &--on-mobile {
      padding: 0;
    }
  }

  @include onLaptop {
    padding: 0 50px;

    &--on-mobile {
