    }
  }
}

sources.styles\\blocks\\grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  column-gap: 20px;

  @include onTablet {
    grid-template-columns: repeat(6, 1fr);
  }

  @include onLaptop {
    grid-template-columns: repeat(12, 1fr);
  }

  &__item {
    @for $start from 1 through 12 {
      @for $end from $start through 12 {
        &--#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }

        &--tablet-#{$start}-#{$end} {
          @include onTablet {
            grid-column: #{$start} / #{$end + 1};
          }
        }

        &--laptop-#{$start}-#{$end} {
          @include onLaptop {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }
  }
}

sources.styles\\blocks\\page.scss:
.page {
  &__body {
    background-color: #e4dfd3;

    @include onDesktop {
      background-color: #fff;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    right: 0;
    left: 0;
    z-index: 1;

    height: 100vh;

    transform: translateX(-100%);
    transition: transform 0.3s;

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-bottom: 60px;

    @include onTablet {
      margin-bottom: 100px;
    }

    @include onDesktop {
      margin-bottom: 200px;
    }
  }

  &__about {
    @include onTablet {
      margin-bottom: 80px;
    }
  }
}

sources.styles\\blocks\\header.scss:
.header {
  &__menu {
    margin-bottom: 10px;

    @include onTablet {
      margin-bottom: 30px;
    }

    @include onLaptop {
      margin-bottom: 80px;
    }

    @include onDesktop {
      margin-bottom: 70px;
    }
  }

  &__content {
    display: block;

    @include onLaptop {
      display: grid;
    }
  }

  &__photo-container {
    position: relative;
    width: 100%;
    height: 270px;

    margin-bottom: 25px;

    @include onTablet {
      height: 500px;
      margin-bottom: 50px;
    }

    @include onLaptop {
      height: 450px;
      margin: 0;
    }
  }

  &__photo {
    position: absolute;
    width: 100%;
    height: 100%;

    object-fit: cover;
    object-position: center;
  }

  &__text {
    padding: 0 20px;

    @include onLaptop {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: flex-start;
      order: -1;

      padding: 0;
    }
  }

  &__title {
    margin-bottom: 12px;

    font-size: 24px;
    line-height: 31px;
    font-weight: normal;
    text-align: center;
    color: $colorGrey;

    @include onTablet {
      padding: 0 121px;
      margin-bottom: 20px;

      font-size: 36px;
      line-height: 47px;
      font-weight: 500;
    }

    @include onLaptop {
      padding: 0;
      margin-bottom: 30px;

      font-size: 60px;
      line-height: 72px;
      text-align: left;

      color: $colorGrey;
    }

    @include onDesktop {
      margin-bottom: 20px;
      line-height: 60px;
    }
  }

  &__subtitle {
    margin-bottom: 46px;

    font-size: 18px;
    line-height: 27px;
    text-align: center;
    color: $colorGrey;

    @include onTablet {
      margin-bottom: 55px;
      font-weight: 500;
    }

    @include onLaptop {
      margin-bottom: 50px;
      font-size: 22px;
      line-height: 29px;
      text-align: left;
    }
  }

  &__button {
    margin: 0 auto;

    @include onLaptop {
      margin: 0;
    }
  }

  &__logo-container {
    display: flex;
    align-items: center;

    @include onLaptop {
      order: -1;
    }
  }

  &__logo {
    display: none;
    margin: 3px 0 0 12px;

    font-family: "Sharp Sans Display No2", sans-serif;
    font-size: 14px;
    line-height: 18px;
    letter-spacing: 0.05em;
    text-transform: uppercase;

    color: $colorGreen;

    @include onLaptop {
      display: block;
    }
  }
}

sources.styles\\blocks\\menu.scss:
.menu {
  background-color: $colorGrey;

  &__list {
    margin-top: 45px;
    list-style: none;
  }

  &__item {
    display: block;
    margin-bottom: 30px;
    padding-bottom: 10px;
    border-bottom: 1px solid #828282;

    text-align: center;

    transition: transform 0.3s;

    &:last-child {
      margin-bottom: 0;
    }

    &:hover {
      transform: scale(105%);
    }
  }

  &__link {
    font-family: "Sharp Sans Display No2", sans-serif;
    font-size: 18px;
    line-height: 130%;
    color: #e4dfd3;
  }
}

sources.styles\\blocks\\navigation.scss:
.navigation {
  display: none;

  @include onLaptop {
    display: block;
  }

  &__list {
    display: flex;
    justify-content: center;

    list-style: none;
  }

  &__item {
    margin-right: 40px;

    &:last-child {
      margin-right: 0;
    }
  }

  &__link {
    position: relative;
    display: block;
    font-family: "Sharp Sans Display No2", sans-serif;
    font-size: 18px;
    line-height: 23px;

    color: $colorGreen;

    &::after {
      content: "";
      display: block;
      position: absolute;
      bottom: -12px;

      width: 100%;
      height: 2px;

      background-color: $colorGreen;
      opacity: 0;

      transition: opacity 0.3s;
    }

    &:hover {
      &::after {
        opacity: 1;
      }
    }
  }
}

sources.styles\\blocks\\top-actions.scss:
