sources.styles\\blocks\\button.scss:
.button {
  display: flex;
  justify-content: center;
  align-items: center;

  width: 280px;
  padding: 20px 0;

  background-color: $colorGrey;
  border: 1px solid $colorGrey;

  font-family: "Sharp Sans Display No2", sans-serif;
  font-size: 16px;
  line-height: 21px;
  text-align: center;
  letter-spacing: 0.15em;
  text-transform: uppercase;

  color: #f2f2f2;

  transition: background-color 0.3s, color 0.3s;

  &:hover {
    background-color: #e4dfd3;
    color: $colorGrey;
  }
}

sources.styles\\blocks\\footer.scss:
.footer {
  display: block;
  padding: 30px 20px 60px;

  background-color: #8c9772;

  @include onTablet {
    display: grid;
  }

  @include onLaptop {
    padding: 60px 50px 65px;
  }

  @include onDesktop {
    padding: 60px 130px 65px;
  }

  &__list {
    list-style: none;

    @include onLaptop {
      display: flex;
    }
  }

  &__list-item {
    margin-bottom: 20px;

    @include onLaptop {
      margin: 0 40px 0 0;

      &:last-child {
        margin: 0;
      }
    }
  }

  &__link {
    position: relative;
    font-size: 14px;
    line-height: 18px;
    color: $colorBeige;

    &::after {
      content: "";
      position: absolute;
      bottom: -12px;
      display: block;
      height: 2px;
      width: 100%;

      background-color: $colorBeige;
      opacity: 0;

      transition: opacity 0.3s;
    }

    &:hover {
      &::after {
        opacity: 1;
      }
    }

    @include onLaptop {
      font-weight: 500;
      font-size: 18px;
      line-height: 23px;
    }
  }

  &__icons {
    display: flex;
    align-items: center;
    margin-bottom: 30px;

    @include onTablet {
      grid-row: 2 / 3;
    }

    @include onLaptop {
      margin-bottom: 0;
    }
  }

  &__icon {
    &:first-child {
      margin-right: 20px;

      @include onLaptop {
        margin-right: 15px;
      }
    }
  }

  &__contacts {
    margin-bottom: 30px;

    @include onTablet {
      grid-row: 1 / 2;
      margin-bottom: 0;
    }

    @include onLaptop {
      margin-bottom: 30px;
    }
  }

  &__contacts-item {
    margin-bottom: 12px;
    padding-top: 3px;
    font-size: 14px;
    line-height: 18px;
    color: $colorBeige;

    &:last-child {
      margin-bottom: 0;
    }

    @include onLaptop {
      margin-bottom: 20px;
      padding: 0;
      font-weight: 500;
      font-size: 18px;
      line-height: 23px;
    }
  }

  &__contacts-phone {
    margin-bottom: 20px;
  }

  &__contacts-time {
    display: block;
  }

  &__copyrights {
    width: 80%;
    margin: 0 auto;

    font-family: "Sharp Sans Display No2", sans-serif;
    font-size: 14px;
    line-height: 18px;
    text-align: center;
    text-transform: uppercase;
    color: $colorBeige;

    @include onTablet {
      margin: 0;
      width: 100%;
      text-align: left;
      text-transform: lowercase;
    }

    @include onLaptop {
      font-size: 16px;
      line-height: 23px;
      text-transform: uppercase;
    }
  }

  &__copyrights-item {
    display: none;
    font-family: "Sharp Sans Display No2", sans-serif;

    @include onLaptop {
      display: inline;
      text-transform: capitalize;
    }
  }
}

sources.styles\\blocks\\info.scss:
.info {
  position: relative;
  display: block;
  padding: 0 20px;

  @include onLaptop {
    display: grid;
    padding: 0;
  }

  &__item {
    @include onLaptop {
      padding: 100px 0;
    }
  }

  &__item-link {
    @include onTablet {
      width: 280px;
      margin: 0 auto;

      text-align: center;
    }

    @include onLaptop {
      width: 100%;
      text-align: left;

      &::after {
        content: "";
        position: absolute;
        bottom: 0;
        right: -50px;
        display: block;
        width: calc(50% + 50px);
        height: 1px;
        background-color: $colorGreen;
      }
    }
  }

  &__link {
    font-size: 18px;
    line-height: 27px;
    letter-spacing: 0.05em;
    text-transform: uppercase;

    color: $colorGreen;

    transition: color 0.3s;

    &:hover {
      color: $colorGrey;
    }

    @include onTablet {
      font-weight: 500;
    }

    @include onLaptop {
      font-size: 24px;
      line-height: 36px;
      letter-spacing: 0.05em;
    }
  }

  &__item-text {
    @include onLaptop {
      &::before {
        content: "";
        position: absolute;
        top: 0;
        left: -50px;
        display: block;
        width: 45%;
        height: 1px;
        background-color: $colorGreen;
      }
    }
  }

  &__text {
    display: none;

    font-weight: bold;
    font-size: 15px;
    line-height: 24px;

    color: $colorGrey;

    @include onLaptop {
      display: block;
    }
  }
}

sources.styles\\blocks\\about.scss:
.about {
  position: relative;
  display: block;

  @include onTablet {
    display: grid;
    padding-left: 20px;
  }

  @include onLaptop {
    align-items: end;
    padding-left: 50px;
  }

  @include onDesktop {
    align-items: center;
  }

  &__name {
    display: none;
    position: absolute;
    top: 0;

    font-family: "Sharp Sans Display No2", sans-serif;
    font-size: 14px;
    line-height: 18px;
    letter-spacing: 0.05em;
    text-transform: uppercase;

    color: rgba(52, 79, 16, 0.5);

    transform: rotate(-90deg) translateX(-50%) translateY(-250%);

    &::after {
      content: "";
      position: absolute;
      top: 50%;
      right: calc(100% + 10px);
      display: block;
      width: 100px;
      height: 1px;

      background-color: rgba(52, 79, 16, 0.5);
    }

    @include onLaptop {
      display: block;
    }
  }

  &__title {
    margin-bottom: 12px;

    font-size: 24px;
    line-height: 36px;
    font-weight: normal;
    letter-spacing: 0.05em;

    text-transform: uppercase;

    color: $colorGreen;

    @include onTablet {
      font-weight: 500;
    }

    @include onLaptop {
      margin-bottom: 20px;
      font-size: 36px;
      line-height: 54px;
    }

    @include onDesktop {
      margin-bottom: 16px;
      line-height: 40px;
    }

    &--creators {
      @include onLaptop {
        line-height: 47px;
      }

      @include onDesktop {
        line-height: 40px;
      }
    }
  }

  &__info {
    margin-bottom: 45px;

    font-size: 16px;
    line-height: 24px;

    color: $colorGrey;

    @include onTablet {
      font-weight: 500;
    }

    @include onLaptop {
      margin-bottom: 30px;
    }

    &--hide {
      display: none;

      @include onLaptop {
        display: block;
        margin-bottom: 40px;
      }
    }

    &--creators {
      margin-bottom: 36px;

      @include onTablet {
        margin-bottom: 12px;
      }

      @include onDesktop {
        margin-bottom: 30px;
      }
    }
  }

  &__link {
    position: relative;

    font-family: "Sharp Sans Display No2", sans-serif;
    font-size: 14px;
    line-height: 18px;

    letter-spacing: 0.05em;
    text-transform: uppercase;

    color: $colorGreen;

    &::after {
      content: "";
      position: absolute;
      bottom: -12px;
      display: block;
      opacity: 0;
      width: 100%;
      height: 1px;
      background-color: $colorGreen;

      transition: opacity 0.3s;
    }

    &:hover {
      &::after {
        opacity: 1;
      }
    }

    &--creators {
      @include onTablet {
        display: inline-block;
        margin-top: 44px;
      }

      @include onLaptop {
        margin-top: 20px;
      }
    }
  }

  &__photo-container {
    position: relative;
    display: none;
    width: 100%;
    height: 320px;

    @include onTablet {
      display: block;
    }

    @include onLaptop {
      height: 530px;
    }

    &--small {
      display: none;
      height: 430px;

      @include onLaptop {
        display: block;
      }
    }

    &--creators {
      height: 435px;

      @include onLaptop {
        height: 670px;
      }
    }
  }

  &__photo {
    position: absolute;
    width: 100%;
    height: 100%;

    object-fit: cover;
    object-position: center;

    @include onDesktop {
      &--small {
        bottom: -50px;
      }
    }
  }

  &__button {
    margin-top: 45px;

    @include onLaptop {
      margin-top: 60px;
    }
  }
}
